CREATE PROCEDURE dbo.proc_transform_235
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_235
    SET payload = LEFT(payload, 1000) + N'|V4-235|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_235;
END
